        static int BFS(char[,] maze, int currentRow, int currentCol, int destinationRow, int destinationCol)
        {
            // Method to search for destination cell using BFS(breadth first search)

            int pathLength = 0;
            Queue<int> qRow = new Queue<int>();
            Queue<int> qCol = new Queue<int>();

            qRow.Enqueue(currentRow);
            qCol.Enqueue(currentCol);

            while (qRow.Count != 0)
            {
                currentRow = qRow.Dequeue();
                currentCol = qCol.Dequeue();
                if(currentRow == destinationRow && currentCol == destinationCol)
                {
                    pathLength = FindAndSetPath(maze, destinationRow, destinationCol);
                    Console.WriteLine($"\nShortest path length = {pathLength}");
                    CleanMaze(maze);
                    maze[destinationRow, destinationCol] = 'f';
                    Print(maze);
                    return pathLength;
                }

                if(IsPassable(maze, currentRow, currentCol + 1)) // Search right
                {
                    qRow.Enqueue(currentRow);
                    qCol.Enqueue(currentCol + 1);
                    maze[currentRow, currentCol + 1] = 'r';
                }

                if(IsPassable(maze, currentRow + 1, currentCol)) // Search down
                {
                    qRow.Enqueue(currentRow + 1);
                    qCol.Enqueue(currentCol);
                    maze[currentRow + 1, currentCol] = 'd';
                }

                if(IsPassable(maze, currentRow, currentCol - 1)) // Search left
                {
                    qRow.Enqueue(currentRow);
                    qCol.Enqueue(currentCol - 1);
                    maze[currentRow, currentCol - 1] = 'l';
                }

                if(IsPassable(maze, currentRow - 1, currentCol)) // Search up
                {
                    qRow.Enqueue(currentRow - 1);
                    qCol.Enqueue(currentCol);
                    maze[currentRow - 1, currentCol] = 'u';
                }
            }

            return pathLength;
        }


        static void Print(char[,] array)
        {
            // Method to print maze

            for(int row = 0; row < array.GetLength(0); row++)
            {
                for(int col = 0; col < array.GetLength(1); col++)
                {
                    Console.Write(array[row, col]);
                }

                Console.WriteLine();
            }
        }


        static bool IsPassable(char[,] maze, int row, int col)
        {
            // Method to check whether given cell is passable or not

            if((row >= 0 && row < maze.GetLength(0)) && (col >= 0 && col < maze.GetLength(1)) && maze[row, col] == ' ')
            {
                return true;
            }
            else
            {
                return false;
            }
        }


        static void FindShortestPathBetween(char[,] maze, int startRow, int startCol, int destinationRow, int destinationCol)
        {
            // Helper method which checks whether given start cell and destination cell are valid. Prints original maze and path.

            if(startRow < 0 || startRow >= maze.GetLength(0) || startCol < 0 || startCol >= maze.GetLength(1) || destinationRow < 0 || destinationRow >= maze.GetLength(0) || destinationCol < 0 || destinationCol >= maze.GetLength(1) || (startRow == destinationRow && startCol == destinationCol))
            {
                Console.WriteLine("Invalid start cell or destination cell");
                return;
            }

            char tempDestination = maze[destinationRow, destinationCol];

            maze[startRow, startCol] = 's';
            maze[destinationRow, destinationCol] = 'f';
            Console.WriteLine("\nmaze -");
            Print(maze);
            maze[destinationRow, destinationCol] = tempDestination;
            if(BFS(maze, startRow, startCol, destinationRow, destinationCol) == 0)
            {
                Console.WriteLine("\nNo path found");
            }
        }


        static int FindAndSetPath(char[,] array, int row, int col)
        {
            // Method to find and set path by backtracting

            char direction = array[row, col];
            int pathLength = 0;

            while(direction != 's')
            {
                pathLength++;
                array[row, col] = 's';
                row = SetRow(direction, row);
                col = SetCol(direction, col);
                direction = array[row, col];
            }

            return pathLength;
        }


        static int SetRow(char direction, int row)
        {
            // Method which return previous row

            if(direction == 'r' || direction == 'l')
            {
                return row;
            }
            else if(direction == 'd')
            {
                return row - 1;
            }
            else
            {
                return row + 1;
            }
        }


        static int SetCol(char direction, int col)
        {
            // Method which return previous col

            if(direction == 'r')
            {
                return col - 1;
            }
            else if(direction == 'd' || direction == 'u')
            {
                return col;
            }
            else
            {
                return col + 1;
            }
        }


        static void CleanMaze(char[,] array)
        {
            // Method to clean maze i.e. to replace 'r', 'd', 'l', 'u' with ' '

            for(int row = 0; row < array.GetLength(0); row++)
            {
                for(int col = 0; col < array.GetLength(1); col++)
                {
                    if(array[row, col] == 'r' || array[row, col] == 'd' || array[row, col] == 'l' || array[row, col] == 'u')
                    {
                        array[row, col] = ' ';
                    }
                }
            }
        }


        static void InitMaze(char[,] array)
        {
            bool isChar;

            Console.WriteLine("\nNow make your maze\nPassable cell - ' '\nImpassable cell - '*'");
            for(int row = 0; row < array.GetLength(0); row++)
            {
                for(int col = 0; col < array.GetLength(1); col++)
                {
                    do
                    {
                        Console.Write($"Cell ({row}, {col}) = ");
                        isChar = Char.TryParse(Console.ReadLine(), out array[row, col]);
                        if(!isChar || (array[row, col] != ' ' && array[row, col] != '*'))
                        {
                            Console.WriteLine("\nEnter either -\n' ' i.e. space for Passable cell\n'*' i.e. asterik for Impassable cell");
                        }
                    }
                    while (!isChar || (array[row, col] != ' ' && array[row, col] != '*'));
                }
            }
        }


